INSERT INTO `TEMPLATE_HISTORY` VALUES (1,453,1,'2024-01-05 00:20:54','u67u67','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\"><head>\n  <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n  <meta name=\"viewport\" content=\"initial-scale=1.0\">\n  <meta name=\"format-detection\" content=\"telephone=no\">\n  <title>Customer Relation</title>\n  \n  <style type=\"text/css\" data-inline=\"true\">\n    body{ Margin: 0; padding: 0; }\n    img{ border: 0px; display: block; }\n\n    .socialLinks{ font-size: 6px; }\n    .socialLinks a{\n      display: inline-block;\n    }\n    .socialIcon{\n      display: inline-block;\n      vertical-align: top;\n      padding-bottom: 0px;\n      border-radius: 100%;\n    }\n    .oldwebkit{ max-width: 570px; }\n    td.vb-outer{ padding-left: 9px; padding-right: 9px; }\n    table.vb-container, table.vb-row, table.vb-content{\n      border-collapse: separate;\n    }\n    table.vb-row{\n      border-spacing: 9px;\n    }\n    table.vb-row.halfpad{\n      border-spacing: 0;\n      padding-left: 9px;\n      padding-right: 9px;\n    }\n    table.vb-row.fullwidth{\n      border-spacing: 0;\n      padding: 0;\n    }\n    table.vb-container{\n      padding-left: 18px;\n      padding-right: 18px;\n    }\n    table.vb-container.fullpad{\n      border-spacing: 18px;\n      padding-left: 0;\n      padding-right: 0;\n    }\n    table.vb-container.halfpad{\n      border-spacing: 9px;\n      padding-left: 9px;\n      padding-right: 9px;\n    }\n    table.vb-container.fullwidth{\n      padding-left: 0;\n      padding-right: 0;\n    }\n  </style>\n  <style type=\"text/css\">\n    /* yahoo, hotmail */\n    .ExternalClass, .ExternalClass p, .ExternalClass span, .ExternalClass font, .ExternalClass td, .ExternalClass div{ line-height: 100%; }\n    .yshortcuts a{ border-bottom: none !important; }\n    .vb-outer{ min-width: 0 !important; }\n    .RMsgBdy, .ExternalClass{\n      width: 100%;\n      background-color: #3f3f3f;\n      background-color: #3f3f3f}\n\n    /* outlook */\n    table{ mso-table-rspace: 0pt; mso-table-lspace: 0pt; }\n    #outlook a{ padding: 0; }\n    img{ outline: none; text-decoration: none; border: none; -ms-interpolation-mode: bicubic; }\n    a img{ border: none; }\n\n    @media screen and (max-device-width: 600px), screen and (max-width: 600px) {\n      table.vb-container, table.vb-row{\n        width: 95% !important;\n      }\n\n      .mobile-hide{ display: none !important; }\n      .mobile-textcenter{ text-align: center !important; }\n\n      .mobile-full{\n        float: none !important;\n        width: 100% !important;\n        max-width: none !important;\n        padding-right: 0 !important;\n        padding-left: 0 !important;\n      }\n      img.mobile-full{\n        width: 100% !important;\n        max-width: none !important;\n        height: auto !important;\n      }   \n    }\n  </style>\n  <style type=\"text/css\" data-inline=\"true\">\n    \n    #ko_sideArticleBlock_1 .links-color a, #ko_sideArticleBlock_1 .links-color a:link, #ko_sideArticleBlock_1 .links-color a:visited, #ko_sideArticleBlock_1 .links-color a:hover{\n      color: #3f3f3f;\n      color: #3f3f3f;\n      text-decoration: underline\n    }\n     #ko_sideArticleBlock_1 .long-text p{ Margin: 1em 0px }  #ko_sideArticleBlock_1 .long-text p:last-child{ Margin-bottom: 0px }  #ko_sideArticleBlock_1 .long-text p:first-child{ Margin-top: 0px } </style>\n</head>\n<body bgcolor=\"#3f3f3f\" text=\"#919191\" alink=\"#cccccc\" vlink=\"#cccccc\" style=\"background-color: #3f3f3f; color: #919191;\">\n\n  <center>\n\n  <!-- preheaderBlock -->\n  <!-- /preheaderBlock -->\n\n  <table class=\"vb-outer\" width=\"100%\" cellpadding=\"0\" border=\"0\" cellspacing=\"0\" bgcolor=\"#bfbfbf\" style=\"background-color: #bfbfbf;\" id=\"ko_sideArticleBlock_1\">\n    <tbody><tr>\n      <td class=\"vb-outer\" align